const GetNotesFromServer = () => {
    var notesList;
    axios.get('http://gateway-sandbox.apps.ca-central-1.starter.openshift-online.com/gateway/getNotes')
    .then(response => {
        console.log(response.data.notes[0]);
        var note;
        for (note of response.data.notes) {
             notesList += <><p>note</p><br/></>;
        }
    })
    .catch(error => {
        console.log(error);
    })
    console.log("here" + notesList)
    return <p>hello</p>;
}

